@Tznkai: You know what, you're right.  I wasn't the right person to do that, I should have asked an admin to do so.  But, I wasn't looking for revenge.  I was looking for the vandalism to stop.  I didn't want the person fired, just his internet access suspended.  After AIV report after AIV report, asking two admins for help (they told the user to stop editing and establish consensus) and trying (and failing miserably) at talking with the user, I thought I had no other choice.  But you are right, it was the wrong choice.  Like I said above...I fucked up.
@Snowman: I was meaning if he was still employed (meaning still able to access the internet from that IP) it didn't have the intended effect.  As I said above, I was not looking to get the user fired, just his internet access suspended. -  • Talk • "

I list the peer reviewed publications that support the information that the use CRUSIO continues to remove is shown below. The name of the system that was developed in Dr. Timiras lab is called the Automated Imaging Microscope System and not the automated tissue image analysis system, that the user CRUSIO continues to call it. Please refer to the PUBMED publication at http://www.ncbi.nlm.nih.gov/pubmed/15990721?dopt=AbstractPlus to verify the name in the 4th sentence of the Abstract. Please verify the information related to CREA at the CREA web site http://crea.berkeley.edu/paul_segall_profile.shtml and http://crea.berkeley.edu/crea.shtml. I would be very happy to discuss these references with you and information with you.

